export type MaybeFactFindPension = FactFindPension | null; // null means no pension

export type FactFindPensionWithPension = FactFindPension & {
 pension: MaybePension;
};

export type FactFindPensionWithPensionAndSalary = FactFindPensionWithPension & {
 salary: number;
};

export type FactFindPensionWithPensionAndSalaryAndFundValue = FactFindPensionWithPensionAndSalary & {
 fundValue: number;
};

export type FactFindPensionWithPensionAndSalaryAndFundValueAndContributions = FactFindPensionWithPensionAndSalaryAndFundValue & {
 contributions: {
 frequency: string;
 employeePercentage: number;
 employerPercentage: number;
 employeeAmount: number;
 employerAmount: number;
 };
};

