Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// chrome extension code
chrome.runtime.onInstalled.addListener(function() {
  chrome.contextMenus.create({
    title: "Take Screenshot",
    contexts: ["page"],
    onclick: function(info) {
      chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
        var filename = "screenshot-" + Date.now() + ".png";
        chrome.downloads.download({
          url: dataUrl,
          filename: filename,
          saveAs: true
        });
      });
    }
  });
});
```
This code creates a context menu item when the extension is installed. When the user clicks on the context menu item, it takes a screenshot of the current tab and saves it to a folder on the user’s computer. The filename of the screenshot is generated using the current date and time.
